$(document).ready(function(){var url_string=window.location.href,url=new URL(url_string),access_token;$.urlParam=function(name){var results=new RegExp("[?&]"+name+"=([^&#]*)").exec(window.location.href.replace("#","?"));return results==null?0:results[1]||0};access_token=$.urlParam("access_token");$.ajax({type:"POST",url:"/Login/FacebookLoginResult",data:{token:access_token},dataType:"json",cache:!1,success:function(result){window.location.href=result!=null&&result.length>0?result:url.origin+"/Home/Index"},error:function(){window.location.href=url.origin+"/Home/Index?provider_error=1"}})});